std::vector<std::string> m_ipfs_attempts;

bool fetch_and_pin_rom_file(std::string media_path, std::vector<std::string> paths)
{
    bool result = false;

    if (!media_path.empty() && !util::is_directory_separator(media_path.back()))
        media_path.append(PATH_SEPARATOR);

    for (auto &path : paths)
    {
        if (std::find(m_ipfs_attempts.begin(), m_ipfs_attempts.end(), path) == m_ipfs_attempts.end())
        {
            m_ipfs_attempts.push_back(path);

            std::string romfile = path + ".zip";

            if (m_romcids.find(romfile) == m_romcids.end())
                continue;

            std::string cid = m_romcids[romfile];
            std::string romfullpath = media_path + romfile;

            system(util::string_format("ipfs cat %s > %s && ipfs add %s", cid, romfullpath, romfullpath).c_str());

            result = true;
        }
    }

    return result;
}

